import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./Home";
import Login from "./Login";
import SignUp from "./SignUp";
import Protecting from "./Protecting";
import { useEffect, useState } from "react";

function App() {
  console.warn(Data);
  return (
    <div className="App">
      <h1>GET API CALL</h1>
      <table>
        <tr>
          <td>ID</td>
          <td></td>
          <td>ID</td>
          <td>ID</td>
        </tr>
      </table>
      <BrowserRouter>
        <Routes>
          <Route
            path="/"
            element={
              <Protecting>
                <Login />
              </Protecting>
            }
          />
          <Route path="/Login" element={<Login />} />
          <Route path="/SignUp" element={<SignUp />} />
          <Route
            path="/Home"
            element={
              <Protecting>
                <Home />
              </Protecting>
            }
          />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
